            i: 0
        }
    }

    render() {
        return(
            <div>
                <div>
                    <div>{data[this.state.i].name.first}</div>
                    <div>{data[this.state.i].name.last}</div>
                    <div>{data[this.state.i].city}</div>
                </div>
                <div>
                    <button></button>
                    <button></button>

                </div>
            </div>
        )
    }
}

export default MainContent
